import React from "react";

const Menu = () => {
  return (
    <div class="ui cards">
      <div class="ui red fluid card">
        <div class="content">
          <div class="header">Option 1</div>
        </div>
      </div>
      <div class="ui orange fluid card">
        <div class="content">
          <div class="header">Option 2</div>
        </div>
      </div>
      <div class="ui yellow fluid card">
        <div class="content">
          <div class="header">Option 3</div>
        </div>
      </div>
    </div>
  );
};

export default Menu;
